css:
.editor-colors {
  background-color: #181818;
  color: #e6e6e6;
  line-height: 1.5em;
}
.editor {
  background-color: #181818;
  color: #e6e6e6;
}
.editor .scroll-view {
  padding-left: .5em;
}
.editor .wrap-guide {
  background-color: #232323;
}
.editor .indent-guide {
  color: #3c3f41;
}
.editor .invisible-character {
  color: #3c3f41;
}
.editor .gutter {
  background-color: #232323;
  color: #969896;
  overflow: visible;
}
.editor .gutter .line-number.cursor-line {
  position: relative;
  background-color: #2c2a28;
  color: #969896;
}
.editor .gutter .line-number.cursor-line:before {
  display: none;
  content: ' ';
  position: absolute;
  top: 0;
  right: -5px;
  height: 0px;
  background-color: transparent;
  width: 0px;
  border-top: 9px solid transparent;
  border-bottom: 9px solid transparent;
  border-left: 5px solid #2c2a28;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #969896;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #969896;
}
.editor .invisible {
  color: #e6e6e6;
}
.editor .cursor {
  color: #ffffff;
}
.editor .selection .region {
  background-color: #0080ff;
}
.editor .search-results .marker .region {
  background-color: #ddaa44;
}
.editor .search-results .marker.current-result .region {
  background-color: #0080ff;
}
/**
 * Packages
 */
.bracket-matcher {
  border-bottom: 1px solid #e6e6e6;
}
.spell-check .misspelling {
  border-bottom: 1px dashed #990000;
}
.comment {
  color: #6a6a6a;
}
.keyword {
  color: #e6e6e6;
}
.keyword.control {
  color: #ffff66;
}
.keyword.operator {
  color: #e6e6e6;
}
.keyword.other.special-method {
  color: #66ffff;
}
.keyword.other.unit {
  color: #e6e6e6;
}
.keyword.regexp {
  color: #e50000;
}
.storage {
  color: #ffff66;
}
.constant {
  color: #e6e6e6;
}
.constant.character.escape {
  color: #e6e6e6;
}
.constant.numeric {
  color: #e6e6e6;
}
.constant.other.color {
  color: #e6e6e6;
}
.constant.other.symbol {
  color: #e6e6e6;
}
.constant.regexp {
  color: #e50000;
}
.variable {
  color: #ffff66;
}
.variable.interpolation {
  color: #b20000;
}
.variable.parameter.function {
  color: #e6e6e6;
}
.variable.less {
  color: #66ffff;
}
.invalid.illegal {
  background-color: #e50000;
  color: #181818;
}
.string {
  color: #66ffff;
}
.string.regexp {
  color: #e50000;
}
.string.regexp .source.ruby.embedded {
  color: #e50000;
}
.string.other.link {
  color: #e50000;
}
.punctuation.definition.comment {
  color: #6a6a6a;
}
.punctuation.definition.tag {
  color: #969896;
}
.punctuation.definition.keyword {
  color: #ffff66;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #969896;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #66ffff;
}
.punctuation.definition.bold {
  color: #e6e6e6;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.definition.regexp {
  color: #e50000;
}
.punctuation.section.embedded {
  color: #b20000;
}
.support.class {
  color: #e6e6e6;
}
.support.function {
  color: #66ffff;
}
.support.function.any-method {
  color: #66ffff;
}
.support.function.less {
  color: #969896;
}
.support.quote {
  color: #969896;
}
.entity.name.function {
  color: #e6e6e6;
}
.entity.name.type {
  color: #990000;
}
.entity.name.class,
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.section {
  color: #66ffff;
}
.entity.name.tag {
  color: #969896;
}
.entity.other.inherited-class {
  color: #00ff00;
}
.entity.other.attribute-name {
  color: #ffff66;
}
.entity.other.attribute-name.id {
  color: #ffff66;
}
.meta {
  color: #969896;
}
.meta.class {
  color: #e50000;
}
.meta.link {
  color: #66ffff;
}
.meta.require {
  color: #66ffff;
}
.meta.selector {
  color: #969896;
}
.meta.separator {
  background-color: #3c3f41;
  color: #e6e6e6;
}
.meta.tag.sgml {
  color: #990000;
}
.meta.id.toc-list {
  color: #66ffff;
}
.regexp.constant.character {
  color: #e50000;
}
.none {
  color: #e6e6e6;
}
.markup {
  color: #e6e6e6;
}
.markup.bold {
  font-weight: 800;
}
.markup.italic {
  font-style: italic;
}
.markup.changed {
  color: #00ff00;
}
.markup.deleted {
  color: #e50000;
}
.markup.heading {
  color: #e6e6e6;
  font-weight: 800;
}
.markup.inserted {
  color: #00ff00;
}
.markup.list {
  color: #969896;
}
.markup.quote {
  color: #969896;
}
.markup.raw.inline {
  color: #969896;
}
.markup.raw {
  color: #969896;
}
.source .gfm {
  -webkit-font-smoothing: antialiased;
}
.gfm.comment {
  color: #e6e6e6;
}
.gfm.list {
  color: #969896;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
